import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import EventCreate from './components/ClassComponents/EventCreate';
import EventList from './components/FunctionalComponents/EventList';
import EventDetails from './components/FunctionalComponents/EventDetails';
import EventCalendar from './components/FunctionalComponents/EventCalendar';
import Login from './components/Auth/Login';
import Signup from './components/Auth/Signup';
import { EventProvider } from './context/EventContext';
import { AuthProvider, useAuth } from './context/AuthContext';
import './App.css';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { currentUser } = useAuth();
  if (!currentUser) {
    return <Navigate to="/login" />;
  }
  return children;
};

function AppContent() {
  const { currentUser, logout } = useAuth();

  const handleLogout = () => {
    logout();
    window.location.href = '/login';
  };

  return (
    <EventProvider>
      <div className="app">
        <nav className="navbar">
          <div className="nav-brand">Event Management System</div>
          <ul className="nav-links">
            <li><Link to="/events">Home</Link></li>
            {currentUser ? (
              <>
                <li><Link to="/create">Create Event</Link></li>
                <li><Link to="/calendar">Calendar</Link></li>
                <li><button onClick={handleLogout} className="logout-btn">Logout</button></li>
              </>
            ) : (
              <>
                <li><Link to="/login">Login</Link></li>
                <li><Link to="/signup">Sign Up</Link></li>
              </>
            )}
          </ul>
        </nav>

        <main className="main-content">
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/events" element={
              <ProtectedRoute>
                <EventList />
              </ProtectedRoute>
            } />
            <Route path="/create" element={
              <ProtectedRoute>
                <EventCreate />
              </ProtectedRoute>
            } />
            <Route path="/calendar" element={
              <ProtectedRoute>
                <EventCalendar />
              </ProtectedRoute>
            } />
            <Route path="/event/:id" element={
              <ProtectedRoute>
                <EventDetails />
              </ProtectedRoute>
            } />
            <Route path="/" element={<Navigate to="/events" />} />
          </Routes>
        </main>

        <footer className="footer">
          <p>&copy; 2024 Event Management System. All rights reserved.</p>
        </footer>
      </div>
    </EventProvider>
  );
}

function App() {
  return (
    <AuthProvider>
      <Router>
        <AppContent />
      </Router>
    </AuthProvider>
  );
}

export default App;
